			["preferToUpdate"] = false,
			["customText"] = "function()\n    aura_env.count = aura_env.count or 0\n    aura_env.icon = aura_env.icon or \"\"\n    if not aura_env.last or aura_env.last < GetTime() - 0.25 then\n        aura_env.icon = aura_env.icons[GetRaidTargetIndex(\"player\")] or \"\"\n        aura_env.last = GetTime()\n        aura_env.count = 0\n        for unit in WA_IterateGroupMembers() do\n            if (not UnitIsUnit(unit, \"player\")) and WeakAuras.CheckRange(unit, 3, \"<=\") then\n                aura_env.count = aura_env.count+1\n            end\n        end\n        if aura_env.config[\"saychat\"] and (not aura_env.last2 or aura_env.last2 < GetTime() - 3) and not WeakAuras.IsOptionsOpen() then\n            aura_env.last2 = GetTime()\n            local p = Round((UnitHealth(\"player\")/UnitHealthMax(\"player\"))*100)\n            SendChatMessage(p..\"%\", \"SAY\")\n        end\n    end\n    return aura_env.count, aura_env.icon\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
